import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Grid from '@material-ui/core/Grid';
import Checkbox from '@material-ui/core/Checkbox';
import Paper from '@material-ui/core/Paper';

const StyledTableCell = withStyles(theme => ({
  head: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles(theme => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.background.default,
    },
  },
}))(TableRow);

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData( <Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 1, <input type="date"/>),
  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 2, 'data'),
  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 3, 'data'),
  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 4, 'data'),
  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 5,'data'),
  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 6,'data'),

  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 7,'data'),

  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 8,'data'),
  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 9,'data'),

  createData(<Checkbox defaultChecked color="primary" inputProps={{ 'aria-label': 'secondary checkbox' }} />, 10,'data'),


];

const useStyles = makeStyles({
  table: {
    minWidth: 50,
  },
});

export default function CustomizedTables() {
  const classes = useStyles();

  return (
      <div>
          <Grid item xs={12} sm={6}>
          <Paper >xs=12 sm=6</Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper >xs=12 sm=6</Paper>
        </Grid>
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>selec</StyledTableCell>
            <StyledTableCell align="right">Temas</StyledTableCell>
            <StyledTableCell align="right">Fecha de Evaluacion</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map(row => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="right">{row.calories}</StyledTableCell>
              <StyledTableCell align="right">{row.fat}</StyledTableCell>
              
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </div>
  );
}
